export const ExpenseList = ({expenses}) => {

    return (
        <>
            <ul clasName='list'>
                {expenses.map((expense) =>  {
                    return <Item key={expense.id} expense={expense}/>
                })}
            </ul>
            {expenses.length > 0 && <button className='btn'>Clear List</button>}    

        </>
    )
}

export default ExpenseList;
